import { style } from '@angular/animations';
import { Component, Inject, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { MAT_DIALOG_DATA } from '@angular/material/dialog';
import { SharedService } from 'src/app/services/shared.service';
import Swal from 'sweetalert2';

import * as pdfMake from 'pdfmake/build/pdfmake';
import * as pdfFonts from 'pdfmake/build/vfs_fonts';
import * as moment from 'moment';

pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-dialog-evaluation',
  templateUrl: './dialog-evaluation.component.html',
  styleUrls: ['./dialog-evaluation.component.scss'],
})
export class DialogEvaluationComponent implements OnInit {
  form!: FormGroup;
  resultado: any = null;
  dataApplicant: any;
  nameApplicant: string = '';
  applicantId: string = '';
  dataApplicantById: any;

  // Comfiguración de ponderaciones
  readonly config = {
    pesoEntrevista: 0.6,
    pesoPrueba: 0.4,
    pesoMatematica: 0.5,
    pesoLectoEscritura: 0.5,
    notaMinima: 3.2,
  };

  constructor(
    @Inject(MAT_DIALOG_DATA) public data: any,
    private formBuilder: FormBuilder,
    private sharedService: SharedService
  ) {}

  ngOnInit(): void {
    this.dataApplicant = this.data.applicant.filter((item: any) => {
      if (item.id === this.data.id) {
        this.dataApplicant = item;
        this.applicantId = item.id;
        this.nameApplicant =
          item.firstName +
          ' ' +
          item.secondName +
          ' ' +
          item.firstLastName +
          ' ' +
          item.secondLastName;
        this.dataApplicantById = item;
      }
    });

    this.form = this.formBuilder.group({
      interview: [
        null,
        [Validators.required, Validators.min(0), Validators.max(100)],
      ],
      math: [null, [Validators.required, Validators.min(0), Validators.max(5)]],
      readWrite: [
        null,
        [Validators.required, Validators.min(0), Validators.max(5)],
      ],
    });

    this.form.valueChanges.subscribe(() => this.calcResults());
  }

  calcResults() {
    const interview = parseFloat(this.form.value.interview);
    const math = parseFloat(this.form.value.math);
    const readWrite = parseFloat(this.form.value.readWrite);

    if (isNaN(interview) || isNaN(math) || isNaN(readWrite)) {
      this.resultado = null;
      return;
    }

    const notaEntrevista = (interview * 5) / 100;

    const promPrueba =
      math * this.config.pesoMatematica +
      readWrite * this.config.pesoLectoEscritura;
    const ponderadoEntrevista = notaEntrevista * this.config.pesoEntrevista;
    const ponderadoPrueba = promPrueba * this.config.pesoPrueba;
    const notaFinal = ponderadoEntrevista + ponderadoPrueba;
    const totalAdmit = (notaFinal * 100) / 5;
    const status =
      notaFinal >= this.config.notaMinima ? 'Aprobado' : 'Reprobado';

    this.resultado = {
      promPrueba: promPrueba.toFixed(2),
      notaFinal: notaFinal.toFixed(2),
      notaEntrevista: notaEntrevista.toFixed(2),
      ponderadoEntrevista: ponderadoEntrevista.toFixed(2),
      ponderadoPrueba: ponderadoPrueba.toFixed(2),
      totalAdmit: Math.round(totalAdmit),
      status,
    };
  }

  sendForm() {
    if (this.form.valid) {
      Swal.fire({
        title: 'Enviando ...',
        icon: 'info',
        html: 'Registro diligenciado correctamente',
        allowOutsideClick: false,
        showConfirmButton: false,
      });

      Swal.showLoading();

      const data = {
        ...this.form.value,
        applicantId: this.applicantId,
      };

      this.sharedService.postApplicantEvaluation(data).subscribe({
        next: (res) => {
          Swal.fire({
            title: `Gracias por usar <b>EduTrack<span style="color: #980909">PRO</span></b>`,
            icon: 'success',
            html: ` <p>Registro guardado con éxito</p>`,
            showConfirmButton: false,
            allowOutsideClick: false,
            timer: 3000,
            timerProgressBar: true,
            willClose: () => {
              window.location.reload();
            },
          });
        },
        error: (err) => {
          Swal.fire({
            title: 'Error',
            icon: 'error',
            text: `No se pudo guardar la evaluación. ${err.message}`,
            showConfirmButton: true,
          });
        },
      });
    }
  }

  downloadPDF() {
    this.dataApplicant = this.data.applicant.filter((item: any) => {
      if (item.id === this.data.id) {
        console.log('info PDF: ', item);

        const header = [
          { text: 'Fecha y hora', bold: true, fillColor: '#D9E2F3' },
          { text: 'Entrevista', bold: true, fillColor: '#D9E2F3' },
          { text: 'Aptitud matemática', bold: true, fillColor: '#D9E2F3' },
          { text: 'Lectura crítica', bold: true, fillColor: '#D9E2F3' },
          { text: 'Promedio prueba', bold: true, fillColor: '#D9E2F3' },
          { text: 'T. ponderado', bold: true, fillColor: '#D9E2F3' },
        ];

        const evalData = item.evaluation?.[0] ?? {};

        const body = [
          header,
          [
            moment(evalData.evaluationDate).format('DD/MM/YYYY HH:mm'),
            evalData.interview ?? '0',
            evalData.math ?? '0',
            evalData.readWrite ?? '0',
            evalData.averageTest ?? '0',
            evalData.finalNote ?? '0',
          ],
        ];

        const pdfDefinition = {
          pageOrientation: 'landscape',
          content: [
            {
              image:
                'data:image/png;base64,',
              width: 150, // o ajusta el tamaño como necesites
            },
            {
              text: [
                {
                  text: 'Evaluación aspirante ',
                  fontSize: 14,
                  alignment: 'center',
                },
                {
                  text:
                    item.firstName +
                    ' ' +
                    item.secondName +
                    ' ' +
                    item.firstLastName +
                    ' ' +
                    item.secondLastName,

                  bold: true,
                  fontSize: 14,
                  alignment: 'center',
                  color: '#009da8',
                },
                {
                  text: '\n Doc. Ident: ',
                  fontSize: 14,
                  alignment: 'center',
                },
                {
                  text: item.identificationNumber,
                  fontSize: 14,
                  alignment: 'center',
                  bold: true,
                  color: '#009da8',
                },
              ],
            },

            { text: '\n' },
            { text: '\n' },

            {
              style: 'tableExample',
              table: {
                heights: [30, 30],
                headerRows: 1,
                widths: ['*', '*', '*', '*', '*', '*'],
                body: body,
              },
            },
            {
              margin: [0, 20, 0, 5],
              text: [
                { text: 'Total Admitido: ' },
                { text: '74', color: '#003366', bold: true },
              ],
            },
            {
              text: [
                { text: 'Estado: ' },
                { text: 'APROBADO', bold: true, color: 'green' },
              ],
            },
          ],
          styles: {
            tableExample: {
              margin: [0, 5, 0, 15],
              fontSize: 12,
              alignment: 'center',
            },
          },
        };
        const pdf = pdfMake.createPdf(pdfDefinition);
        pdf.open();
      }
    });
  }
}
